&quot;The Syrian civil war, also known as the Syrian uprising or Syrian crisis, is an ongoing armed conflict in Syria between forces loyal to the Ba'ath government and those seeking to oust it. The unrest began on 15 March 2011, with popular demonstrations that grew nationwide by April 2011. These demonstrations were part of the wider Middle Eastern protest movement known as the Arab Spring. Protesters demanded the resignation of President Bashar al-Assad, whose family has held the presidency in Syria since 1971, as well as the end of Ba'ath Party rule, which began in 1963.&quot;

